// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;

contract PrivateBank {
    struct client{
        address personid;
        uint starttime;
        uint endtime;
        bool ispresent;
        bool expired;
    }
    address public verifier;
    uint public basecost;
    // mapping (address => string) public  dataLink;
    client [100] public _patients;
    // uint [100] public  balance;
    uint public  total;
    address public admin;

    constructor(){
        admin = msg.sender;
        basecost = .002 ether;
        total = 0;
    }

    function registerCandidate(address personID) public payable{
        
        require(msg.value > basecost , "You dont have sufficient credits");

        _patients[total].personid = personID;
        _patients[total].starttime = block.timestamp;
        _patients[  total].ispresent = true;
        _patients[total].expired = false;
        // _patients[total].endtime = block.timestamp + (7 days)*(30*12*10);
        _patients[total].endtime = block.timestamp + (10);
        total = total + 1;
    }

    function getMyRemainingTime(address id) public returns (uint){
        client storage curr = _patients[findIndex(id)];

        if(block.timestamp >= curr.endtime){
            curr.expired = true;
            return 0;
        }
        return (curr.endtime - block.timestamp);
    }

    function findIndex(address id) public view returns (uint) {
        for(uint i = 0 ;i < total; i++){
            if(_patients[i].personid == id){
                return i;
            }
        }        
        require((1==2) , "You have not registered with us !" );
        return (0);
    }

    function isPresent(address id)public view returns (bool){
        uint pos = findIndex(id);
        client memory curr = _patients[pos] ;
        return  curr.ispresent;
    }
    
    function getVerifier()public view returns (address){
        return verifier;
    }

    function expired(address id)public  returns (bool){        
        client storage curr = _patients[findIndex(id)];

        if(block.timestamp >= curr.endtime){
            curr.expired = true;
        }
        return  curr.expired;
    }

    function getContractBalance()public view returns(uint) {
        return address(this).balance;
    }

    function getAllClients()public view returns(client[100] memory ) {
        return _patients;
    }
    
    modifier verify{
        require(msg.sender == verifier,"You are not authorized to do this");
        _;  
    }
    modifier isadmin{
        require(msg.sender == admin,"You are not authorized to do this");
        _;  
    }

    function setVerifier(address verifieraddress)public isadmin {
        verifier = verifieraddress;
    }

    function verification(address id)public verify {
        uint pos = findIndex(id);
        client storage curr = _patients[pos];
        if(curr.ispresent = true){
            curr.ispresent = false;
        }
    }
    function transerferToClient(address payable to) verify public payable returns(string memory) {        
        to.transfer(basecost);
        return  "Success";
    }
    
}
